// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;


import "./ERC165.sol";
import "./interfaces/IERC721.sol";
import "./interfaces/IERC721TokenReceiver.sol";


contract Plum is ERC165, IERC721{

    uint nextId;

    mapping(uint256 => address) private _owners;
    mapping(address => uint256) private _balances;
    mapping(uint256 => address) private _tokenApprovals;

    mapping(address => mapping( address => bool)) private _operatorApprovals;


    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns(bool){
        return interfaceId == type(IERC721).interfaceId || super.supportsInterface(interfaceId);
    }

    function getMyPlums(address owner) public view returns (uint256) {
      require (owner != address(0), "ERC721: zero address");
      return _balances[owner];
    }

    function getAll(address owner) public view returns(uint256 tokens){        
        return _balances[owner];
    }


    function balanceOf(address owner) public view virtual override returns(uint256){

        require (owner != address(0), "ERC721: zero address");
        return _balances[owner];

    }

    function ownerOf(uint256 tokenId) public view virtual override returns(address){
        address owner = _owners[tokenId];

        require (owner != address(0), "ERC721: zero address");
        return owner;
    }

    function approve (address to, uint256 tokenId) public virtual override{
        address owner = ownerOf(tokenId);

        require (to != owner, "ERC721 ERROR: Destination address must be different");

        require (msg.sender == owner || isApprovedForAll(owner, msg.sender), "ERC721 ERROR: You are not the owner or you do no have permissions");

        _approve(to, tokenId);


    }

    function _approve(address to, uint256 tokenId) internal virtual{
        _tokenApprovals[tokenId] = to;
        emit Approval(ownerOf(tokenId), to, tokenId);
    }

    function getApproved(uint256 tokenId) public view virtual override returns(address){

        require (_exists(tokenId), "ERC721 ERROR: tokenId does not exist");

        return _tokenApprovals[tokenId];

    }

    function setApprovalForAll(address operator, bool approved) public virtual override{

        require (operator != msg.sender, "ECR721 ERROR: operator addres must be different");

        _operatorApprovals[msg.sender][operator] = approved;
        emit ApprovalForAll(msg.sender, operator, approved);

    }   

    function isApprovedForAll(address owner, address operator) public view virtual override returns(bool){
        return _operatorApprovals[owner][operator];
    }


    // ----------------------- //

    function safeTransferFrom(address from, address to, uint256 tokenId) public virtual override{

    }

    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory _data) public virtual {

    }

    function _safeTransfer(address from, address to, uint256 tokenId, bytes memory _data) internal virtual{


    }

    function transferFrom(address from, address to, uint256 tokenId) public virtual override {


    }

    function transferFrom(address from, address to, uint256 tokenId, bytes memory data) public virtual override {


    }

    // ----------------------- //


    function _transfer(address from, address to, uint256 tokenId) internal virtual{

        require (ownerOf(tokenId) == from, "ERC721 ERROR: Token id does not exist");

        require (to != address(0), "ERC721 ERROR: transfer to zero address");

        _beforeTokenTransfer(from, to, tokenId);
        _approve(address(0), tokenId);

        _balances[from] -= 1;
        _balances[to] += 1;
        _owners[tokenId] = to;

        emit Transfer(from, to, tokenId);


    }



    function safeMint(address to, uint num) public {        
        for(uint256 i; i < num; i++){
            _safeMint(to, "");
        }

    }

    function _safeMint(address to, bytes memory _data) public{
        _mint(to, nextId);
        require( _checkOnERC721Received( address(0), to, nextId, _data), "ERC721 ERROR: Transfer to non ERC721Receiver implenter" );   
        nextId++;
    }


    function _mint(address to, uint256 tokenId) public virtual {
        require(to != address(0), "ERROR: mint to the zero address");

        require(!_exists(tokenId), "ERROR: token already minted");

        _beforeTokenTransfer(address(0), to, tokenId);

        _balances[to] += 1;
        _owners[tokenId] = to;

        emit Transfer(address(0), to, tokenId);


    }


    function _checkOnERC721Received(address from, address to, uint256 tokenId, bytes memory _data) private returns(bool) {
        if(isContract(to)){
                try IERC721TokenReceiver(to).onERC721Received(msg.sender, from, tokenId, _data) returns (bytes4 retval){
                    return retval == IERC721TokenReceiver(to).onERC721Received.selector;
                } catch (bytes memory reason){
                    if(reason.length == 0){
                        revert("ERC721 ERROR: Transfer to non ERC721Receiver implenter");
                    } else {
                        assembly {
                            revert(add(32, reason), mload(reason))
                        }
                    }
                }
            }else{
                return true;
            }

    }

    function isContract( address _addr ) private view returns(bool) {
        uint32 size;
        assembly {
            size := extcodesize(_addr)
        }
        return(size > 0);

    }


    function _exists(uint256 tokenId) internal view virtual returns(bool) {
        return _owners[tokenId] != address(0);        
    }


    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal virtual {

    }


    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view virtual returns(bool){

        require (_exists(tokenId),"ERC721 ERROR: token id does not exist");
        address owner = ownerOf(tokenId);
        return(spender== owner || getApproved(tokenId) == spender || isApprovedForAll(owner,spender));

    }



}
